class Dunder:
    def __init__(self, name, x, y, z):
        self.name = name 
        self.x = x
        self.y = y
        self.z = z
        self.val = x + y + z

    def __str__(self):
        return f"{self.name}: ({self.x}, {self.y}, {self.z})"

    def __repr__(self):
        return str(self)

    def __len__(self):
        return len(self.name)

    def __round__(self):
        '''Returns point coordinates as a tuple (x,y),
            where x and y are both rounded to the nearest integers.'''
        return round(self.x), round(self.y), round(self.z)

    def __eq__(self, otherPoint):
        '''Returns True if this point's rounded coordinates match
            otherPoint's rounded coordinates.'''
        return round(self) == round(otherPoint)   

    def __bool__(self):
        return True

    def __lt__(self, other):
        return self.val < other

    def __gt__(self, other):
        return self.val > other

    def __contains__(self, item):
        """ Check if the Dunder contains the specified item """
        return item == self.x or item == self.y or item == self.z

    def __add__(self, other):
        """ Add two Dunders """
        return Dunder(self.name, self.x + other.x, self.y + other.y, self.z + other.z)

    def __sub__(self, other):
        """ Subtract two Dunders """
        return Dunder(self.name, self.x - other.x, self.y - other.y, self.z - other.z)

    def __setitem__(self, key, value):
        """ Set item """
        if key == 'x':
            self.x = value
        elif key == 'y':
            self.y = value
        elif key == 'z':
            self.z = value
        else:
           print("Key must be 'x', 'y', or 'z'.")   

    def __del__(self):
        """ Delete the object """
        print(f"Deleting {self.name} object.")

