class Vector:
    def __init__(self, x, y):
        """initialize a new Vector object with x and y components
        arguments:
        x (float) : the x component of the vector
        y (float) : the y component of the vector
        """
        self.x = x
        self.y = y

    def __add__(self, other):
        """returns the vector resulting from the addition of x and y components of 2 vectors"""
        return Vector(self.x + other.x, self.y + other.y)

    def __sub__(self, other):
        """returns the vector resulting from the subtraction of x and y components of 2 vectors"""
        return Vector(self.x - other.x, self.y - other.y)

    def __mul__(self, other):
        """returns the vector resulting from the multiplication of x and y components of 2 vectors"""
        return Vector(self.x * other.x, self.y * other.y)

    def __truediv__(self, other):
        """returns the vector resulting from the division of x and y components of 2 vectors"""
        return Vector(self.x / other.x, self.y / other.y)

    def __str__(self):
        """returns the string representation of the vector"""
        return f"X: {self.x}, Y: {self.y}"

    def __repr__(self):
        """returns the same thing as the str method, when an object is requested in debugger"""
        return self.str__()

    def __getattr__(self, attr):
        """for an undeclared attribute, this returns a not set message"""
        not_set = "attribute does no exist or is not set."
        return not_set

    def __len__(self):
        """returns length of the vector"""
        return round((self.x ** 2 + self.y ** 2) ** 0.5)

    def __bool__(self):
        """returns True if either one of the components is not zero. And returns false if both of them are zero"""
        return bool(self.x or self.y)

    def __reversed__(self):
        """returns the negative or opposite version of a vector"""
        return Vector(-self.x, -self.y)

    def __delattr__(self, other):
        print("the component can't be deleted because the vector would not exist")


