        self.sequence = sequence

    def __len__(self):
        return len(self.sequence)

    def __getitem__(self, index):
        return self.sequence[index]

    def __str__(self):
        return self.sequence

    def __repr__(self):
        return f'DNA("{self.sequence}")'

    def __bool__(self):
        return len(self.sequence) > 0

    def __add__(self, other):
        if isinstance(other, DNA):
            return DNA(self.sequence + other.sequence)
        else:
            raise TypeError("Unsupported operand type(s) for +: 'DNA' and '{}'".format(type(other).__name__))

    def __eq__(self, other):
        if isinstance(other, DNA):
            return self.sequence == other.sequence
        else:
            return False

    def __ne__(self, other):
        return not self.__eq__(other)

    def __lt__(self, other):
        if isinstance(other, DNA):
            return len(self.sequence) < len(other.sequence)
        else:
            raise TypeError("Unsupported operand type(s) for <: 'DNA' and '{}'".format(type(other).__name__))

    def __gt__(self, other):
        if isinstance(other, DNA):
            return len(self.sequence) > len(other.sequence)
        else:
            raise TypeError("Unsupported operand type(s) for >: 'DNA' and '{}'".format(type(other).__name__))


