class DNA:
    """Class representing a DNA sequence."""

    def __init__(self, sequence):
        """Initialize DNA sequence."""
        self.sequence = sequence

    def __len__(self):
        """Return the length of the DNA sequence."""
        return len(self.sequence)

    def __getitem__(self, index):
        """Get the base at the specified index."""
        return self.sequence[index]

    def __str__(self):
        """Return string representation of the DNA sequence."""
        return self.sequence

    def __repr__(self):
        """Return a string representation that can be used to recreate the object."""
        return f'DNA("{self.sequence}")'

    def __bool__(self):
        """Check if the DNA sequence is non-empty."""
        return len(self.sequence) > 0

    def __add__(self, other):
        """Concatenate two DNA sequences."""
        if isinstance(other, DNA):
            return DNA(self.sequence + other.sequence)
        else:
            raise TypeError("Unsupported operand type(s) for +: 'DNA' and '{}'".format(type(other).__name__))

    def __eq__(self, other):
        """Check if two DNA sequences are equal."""
        if isinstance(other, DNA):
            return self.sequence == other.sequence
        else:
            return False

    def __ne__(self, other):
        """Check if two DNA sequences are not equal."""
        return not self.__eq__(other)

    def __lt__(self, other):
        """Check if the length of the DNA sequence is less than the length of another DNA sequence."""
        if isinstance(other, DNA):
            return len(self.sequence) < len(other.sequence)
        else:
            raise TypeError("Unsupported operand type(s) for <: 'DNA' and '{}'".format(type(other).__name__))

    def __gt__(self, other):
        """Check if the length of the DNA sequence is greater than the length of another DNA sequence."""
        if isinstance(other, DNA):
            return len(self.sequence) > len(other.sequence)
        else:
            raise TypeError("Unsupported operand type(s) for >: 'DNA' and '{}'".format(type(other).__name__))


