class Library:
    '''Represents the class library with books in its inventory'''
    def __init__(self, name, books=[]):       #initializing the class Library
        self.name = name
        self.books = books

    def __str__(self):
        '''Gives human-readable information in string representations of an object'''
        return f"{self.name} library has {self.books} in the inventory"

    def __repr__(self):
        '''Returns more information or representations of an object'''
        return f"Library inventory of {self.name} contains {self.books}"

    def __len__(self):
        '''Returns the length of the list created for an object'''
        return len(self.books)        #using len function to get the length of the list

    def __bool__(self):
        '''Returns the boolean value of a library checking whether it has books or not'''
        return bool(self.books)        #using bool function to get the result in Boolean

    def __reversed__(self):
        '''Returns the reversed text of items from the list'''
        return reversed(self.books)

    def __delitem__(self, index):
        '''Deletes the book from the inventory with the index provided '''
        del self.books[index]

    def __contains__(self, book):
        '''Checks whether that specific library contains that specific book or not'''
        return book in self.books

    def __add__(self, otherLibrary):
        '''Adds books of two libraries to create a new list'''
        if isinstance(otherLibrary, Library):
            return Library(self.name, self.books + otherLibrary.books)

    def __sub__(self, otherLibrary):
        '''Subtracts the common books from two different libraries'''
        if isinstance(otherLibrary, Library):
            return Library(self.name, [book for book in self.books if book not in otherLibrary.books])

    def __iadd__(self, otherLibrary):
        '''Using += operator to make it easier for addition of libraries inventory'''
        if isinstance(otherLibrary, Library):    #checks if otherLibrary is an instance of the Library class
            self.books += otherLibrary.books
        return self

    def __or__(self, other):
        '''This method creates a new Library instance with the same name as the current instance (self.name) and computes the union of the books'''
        if isinstance(other, Library):
            return Library(self.name, list(set(self.books) | set(other.books)))    #using the union operator "|"  

    def __and__(self, other):
        '''This method creates a new Library instance with the same name as the current instance (self.name) and computes the intersections(common) of the books and converts them to a new list'''
        if isinstance(other, Library):
            return Library(self.name, list(set(self.books) & set(other.books)))

    def __getitem__(self, index):
        '''Allows the user to get the books from the library inventory using index operator [] '''
        return self.books[index]

    def __setitem__(self, index, value):
        '''Assigns a new value to a book with the help of index'''
        self.books[index] = value

    def __delattr__(self, name):
        '''Deletes the named attribute from the object'''
        if name == "name":
            del self.name
